import React from 'react';
import { useTranslation } from 'react-i18next';
import { debounce } from 'lodash';
import { ComponentType, FC, useEffect, useState } from 'react';

interface WithOfflineMaskProps {}
export default function WithOfflineMask<Props extends WithOfflineMaskProps>(
    WrappedComponent: ComponentType<Props>,
) {
    const Component: FC<Props> = (props) => {
        const { t } = useTranslation();
        const [onLine, setOnLineStatus] = useState(window.navigator.onLine);
        useEffect(() => {
            const wait = 1000;
            const setOnLine = debounce(
                () => setOnLineStatus(window.navigator.onLine),
                wait,
            );

            window.addEventListener('online', setOnLine);
            window.addEventListener('offline', setOnLine);
            return () => {
                window.removeEventListener('online', setOnLine);
                window.removeEventListener('offline', setOnLine);
            };
        }, [onLine]);

        if (onLine) {
            return <WrappedComponent {...props} />;
        }

        return (
            <div className="w-full h-full flex-col-center">
                <img
                    src={
                        'data:image/png;base64,'
                    }
                    alt="500"
                    className="w-[200px]"
                />
                <div className="text-[#808080] mt-[16px]">
                    {t('app.ui.noNetwork')}
                </div>
                <div className="flex-row-center">
                    <div
                        onClick={() => window.location.reload()}
                        className="w-[104px] mt-[20px] border border-solid border-primaryColor rounded-[4px] text-primaryColor  h-[32px] flex-row-center "
                    >
                        {t('app.ui.reload')}
                    </div>
                </div>
            </div>
        );
    };

    Component.displayName = `WithOfflineMask(${
        WrappedComponent.displayName || WrappedComponent.name
    })`;

    return Component;
}
